/* eslint-disable */
import axios from "axios";
import { useEffect } from "react";

function Search(props) {
  const arr = props.names.split(" ");
  var searchWords = {};
  var temp;

  // JSON 형식으로 값 저장
  for (var i in arr) {
    var queryWords = arr[i];
    searchWords[queryWords] = "number";
  }

  try {
    var url = "http://127.0.0.1:8000/api/";
    if (props.typeSelect === "dog") {
      url += "dog";
    } else {
      url += "cat";
    }

    axios
      .get(url, {
        params: { breed: props.breed },
      })
      .then((response) => {
        const searchResults = response.data;
        useEffect(() => {
          temp = searchResults[0];
          console.log(temp);
        }, []);
      });
  } catch (error) {
    console.error(error);
  }

  const message = JSON.stringify(temp);

  return <h1>{message}</h1>;
}

export default Search;
